import React, { useEffect } from "react";
import { Navbar, Container, Nav, Form, Button, Dropdown } from "react-bootstrap";
import { useDispatch, useSelector } from "react-redux";
import { Link, useNavigate } from "react-router-dom";
import { currentAdmin, logoutAdmin } from "../../JS/Actions/admin";
import { current, logout } from "../../JS/Actions/user";
import "./NavBar.css";
import logo from "./VERSTAND.png";
import userico from "./user.png";
import out from "./arrow.png";
const NavBar = () => {

  const dispatch = useDispatch();

  useEffect(() => {
    if (localStorage.getItem("token")) {
      dispatch(current());
    }
  }, [dispatch]);

  useEffect(() => {
    if (localStorage.getItem("token")) {
      dispatch(currentAdmin());
    }
  }, [dispatch]);

  const navigate = useNavigate();
  const isAuth = useSelector((state) => state.userReducer.isAuth);
  const isAuthAdmin = useSelector((state) => state.adminReducer.isAuthAdmin);
  const admin = useSelector((state) => state.adminReducer.admin);
  const user = useSelector((state) => state.userReducer.user);
 
  return (
    
    <header>
  
      <Navbar bg="light" variant="light" className="NavBar">
        <Container>
          <Navbar.Brand href="/">
            <img
              alt="Verstand"
              src={logo}
              width="40%"
              height="10%"
              className="d-inline-block align-top"
            />{" "}   
          </Navbar.Brand>

          <Nav className="me-auto">
            <Nav.Link href="/">Home</Nav.Link>
            <Nav.Link href="/AboutUs">About us</Nav.Link>
            <Nav.Link href="/ContactUs">Contact us</Nav.Link>
            <Nav.Link href="/ProductList">Our Products</Nav.Link>
            
            <Form className="d-flex">
                  <Form.Control
                    type="search"
                    placeholder="Search"
                    className="me-2"
                    aria-label="Search"
                  />
                  <Button variant="outline-success">Search</Button>
                </Form>
                <Nav>
            {isAuth ? (
              <div className="logout">
                  <Dropdown>
                    <Dropdown.Toggle
                      className="v11"
                      id="dropdown-basic"
                      variant="secondary"
                    >
                      <span className="v3">
                        {" "}
                        <img
                          src={userico}
                          height="23px"
                          className="userico"
                          alt="img"
                        />{" "}
                        {user && user.name}
                      </span>
                    </Dropdown.Toggle>

                    <Dropdown.Menu>
                      <Dropdown.Item
                        onClick={() => navigate(`/Profile/${user._id}`)}
                      >
                        Profil
                      </Dropdown.Item>
                      <Dropdown.Item href="/Produits">
                        Nos Produits
                      </Dropdown.Item>
                      <Dropdown.Divider />
                      <Dropdown.Item
                        href="/"
                        onClick={() => dispatch(logout())}
                      >
                        
                        {" "}
                        <img
                          src={out}
                          height="20px"
                          className="userico"
                          alt="img"
                        />
                        Logout
                      </Dropdown.Item>
                    </Dropdown.Menu>
                  </Dropdown>
                </div>
            ) : isAuthAdmin ? (
              <div>
              <div>
               <Link to={"/"}>
                <button onClick={() => dispatch(logoutAdmin())}>Log out</button>
                </Link></div>
                <div>
                <button onClick={() => navigate(`/Profile/${admin._id}`)}>Profile</button>
                </div>
                </div>
            ) : (
              <div className="LogRegis">
                <Nav.Link href="/Login">Login</Nav.Link>
                <Nav.Link href="/Register">Register</Nav.Link>
              </div>
            )}
            </Nav>
          </Nav>
        </Container>
      </Navbar>
    
    </header>
  );
};

export default NavBar;
